import React from 'react';
import { VideoData } from '../lib/supabase';

interface VideoSidebarProps {
  isOpen: boolean;
  onClose: () => void;
  videos: VideoData[];
  onVideoSelect: (video: VideoData) => void;
}

const VideoSidebar: React.FC<VideoSidebarProps> = ({ 
  isOpen, 
  onClose, 
  videos,
  onVideoSelect
}) => {
  const getVideoThumbnail = (url: string) => {
    try {
      if (url.includes('youtube.com') || url.includes('youtu.be')) {
        const videoId = url.includes('youtube.com')
          ? url.split('embed/')[1]?.split('?')[0]
          : url.split('youtu.be/')[1]?.split('?')[0];
        return `https://img.youtube.com/vi/${videoId}/mqdefault.jpg`;
      }
      return null;
    } catch {
      return null;
    }
  };

  return (
    <>
      {/* Overlay que cobre toda a tela */}
      {isOpen && (
        <div
          className="fixed inset-0 bg-black/50 backdrop-blur-sm z-40 transition-opacity duration-300"
          onClick={onClose}
        />
      )}

      {/* Sidebar */}
      <div
        className={`fixed right-0 top-0 h-full w-80 bg-[#1e1e1e]/95 backdrop-blur-sm shadow-2xl transform transition-all duration-300 ease-in-out z-50 
          ${isOpen ? 'translate-x-0' : 'translate-x-full'}`}
      >
        <div className="h-full flex flex-col">
          {/* Header */}
          <div className="p-4 border-b border-[#404040]">
            <div className="flex justify-between items-center">
              <h3 className="text-lg font-semibold text-[#e1aa1e]">Biblioteca de Vídeos</h3>
              <button
                onClick={onClose}
                className="p-1 hover:bg-[#404040] rounded-full transition-colors text-gray-400 hover:text-[#e1aa1e]"
              >
                <svg
                  className="w-5 h-5"
                  fill="none"
                  strokeLinecap="round"
                  strokeLinejoin="round"
                  strokeWidth="2"
                  viewBox="0 0 24 24"
                  stroke="currentColor"
                >
                  <path d="M6 18L18 6M6 6l12 12"></path>
                </svg>
              </button>
            </div>
          </div>

          {/* Lista de Vídeos */}
          <div className="flex-1 overflow-y-auto custom-scrollbar">
            <div className="grid grid-cols-1 gap-3 p-4">
              {videos.map((video) => {
                const thumbnail = getVideoThumbnail(video.url);
                return (
                  <div
                    key={video.id}
                    onClick={() => {
                      onVideoSelect(video);
                      onClose(); // Fecha a sidebar ao selecionar um vídeo
                    }}
                    className="group cursor-pointer"
                  >
                    {/* Título do vídeo */}
                    <h4 className="text-sm font-medium text-[#e1aa1e] mb-2 group-hover:text-[#e1aa1e]/80 transition-colors">
                      {video.title || 'Vídeo sem título'}
                    </h4>

                    {/* Container do Thumbnail */}
                    <div className="relative overflow-hidden rounded-lg border border-[#404040] group-hover:border-[#e1aa1e]/50 transition-colors">
                      {thumbnail ? (
                        <img
                          src={thumbnail}
                          alt={video.title || 'Thumbnail do vídeo'}
                          className="w-full aspect-video object-cover transform group-hover:scale-105 transition-transform duration-300"
                        />
                      ) : (
                        <div className="w-full aspect-video bg-[#2d2d2d] flex items-center justify-center">
                          <svg
                            className="w-12 h-12 text-gray-400 group-hover:text-[#e1aa1e] transition-colors"
                            fill="none"
                            stroke="currentColor"
                            viewBox="0 0 24 24"
                          >
                            <path
                              strokeLinecap="round"
                              strokeLinejoin="round"
                              strokeWidth={2}
                              d="M14.752 11.168l-3.197-2.132A1 1 0 0010 9.87v4.263a1 1 0 001.555.832l3.197-2.132a1 1 0 000-1.664z"
                            />
                            <path
                              strokeLinecap="round"
                              strokeLinejoin="round"
                              strokeWidth={2}
                              d="M21 12a9 9 0 11-18 0 9 9 0 0118 0z"
                            />
                          </svg>
                        </div>
                      )}

                      {/* Overlay de hover */}
                      <div className="absolute inset-0 bg-black/40 opacity-0 group-hover:opacity-100 transition-opacity flex items-center justify-center">
                        <svg
                          className="w-12 h-12 text-[#e1aa1e]"
                          fill="none"
                          stroke="currentColor"
                          viewBox="0 0 24 24"
                        >
                          <path
                            strokeLinecap="round"
                            strokeLinejoin="round"
                            strokeWidth={2}
                            d="M14.752 11.168l-3.197-2.132A1 1 0 0010 9.87v4.263a1 1 0 001.555.832l3.197-2.132a1 1 0 000-1.664z"
                          />
                        </svg>
                      </div>
                    </div>
                  </div>
                );
              })}
            </div>
          </div>
        </div>
      </div>
    </>
  );
};

export default VideoSidebar;
